import React from 'react'

const Header = () => {
  return (
    <header className='sticky top-0 w-full py-6 shadow-lg'>
      <div class="container max-w-[1200px] w-full mx-auto px-2">
        {/* Logo */}
        <a href="" className='text-3xl font-bold'>Logo</a>
        {/* Right header */}
        <div>
            {/* Search button */}
            <button><i class="fa-solid fa-magnifying-glass"></i></button>
            {/* Favorite button */}
        </div>
      </div>
    </header>
  )
}

export default Header
